import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Login from './components/Login';
import DashboardGestor from './components/DashboardGestor';
import DashboardCorretor from './components/DashboardCorretor';
import CreateAdmin from './components/CreateAdmin';
import DistribuirLeads from './components/DistribuirLeads';
import GerenciarCorretores from './components/GerenciarCorretores';
import Layout from './components/Layout';
import { auth } from './firebase';

function PrivateRoute({ children }) {
  const user = auth.currentUser;
  
  if (!user) {
    return <Navigate to="/" />;
  }

  return <Layout>{children}</Layout>;
}

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/create-admin" element={<CreateAdmin />} />
        <Route
          path="/dashboard-gestor"
          element={
            <PrivateRoute>
              <DashboardGestor />
            </PrivateRoute>
          }
        />
        <Route
          path="/dashboard-gestor/leads"
          element={
            <PrivateRoute>
              <DistribuirLeads />
            </PrivateRoute>
          }
        />
        <Route
          path="/dashboard-gestor/corretores"
          element={
            <PrivateRoute>
              <GerenciarCorretores />
            </PrivateRoute>
          }
        />
        <Route
          path="/dashboard-corretor"
          element={
            <PrivateRoute>
              <DashboardCorretor />
            </PrivateRoute>
          }
        />
      </Routes>
    </Router>
  );
}

export default App;
